import React, { useState, useEffect } from "react";
import * as axios from "axios";

import "./ResProfile.css";
import { Link } from "react-router-dom";

function NavbarBG() {
  return <div id="navbarbg"></div>;
}

function NavbarItems2() {
  return (
    <div id="NI2">
      <h1 id="prohr">HOSTEL RESIDENT</h1>
      <Link to="/resident_home" id="proh">
        Home
      </Link>
      <Link to="/foodqr" id="fqr">
        Food QR
      </Link>
      <a href="#" id="com">
        Complaints
      </a>
      <Link to="/meal-selection" id="mealselection">
        Meal Selection
      </Link>
      <Link to="/" id="log">
        Logout
      </Link>
    </div>
  );
}

function ProfileHeading() {
  return <h1 id="ProfileGrad">Profile</h1>;
}

function ProfileBoxBG({ userDetails }) {
  return (
    <div id="ProfileBoxBg">
      <div id="ProfilePhotoWrapper">
        <img
          id="ProfilePhoto"
          src="/FoodIcons/Profile.jpg"
          alt="Profile Photo"
        />
      </div>
      <div id="ProfileDetails">
        <p id="ResidentName">Name: {userDetails.name || "N/A"}</p>
        <p id="ResidentEmailID">Email ID: {userDetails.email || "N/A"}</p>
        <p id="ResidentID">Resident ID: {userDetails.residentId || "N/A"}</p>
        <p id="Address">Address: {userDetails.address || "N/A"}</p>
      </div>
    </div>
  );
}

function WeekButtonsInProfile({ onSelectDay }) {
  const days = [
    "Monday",
    "Tuesday",
    "Wednesday",
    "Thursday",
    "Friday",
    "Saturday",
    "Sunday",
  ];
  return (
    <div id="BtnsBGProfileWrapper">
      <div id="BtnsBGProfile">
        {days.map((day) => (
          <button key={day} onClick={() => onSelectDay(day)}>
            {day}
          </button>
        ))}
      </div>
    </div>
  );
}

function BookingsDetailsInProfile({ selectedMeal }) {
  return (
    <div id="BookingDetailsBGWrapper">
      <div id="BookingDetailsBG">
        <div id="breakfastProfile">
          <p id="breakHead">Breakfast</p>
          <p id="breakfastDetails">
            {selectedMeal?.breakfastDish || "Not selected"}
          </p>
        </div>
        <div id="lunchProfile">
          <p id="lunchHead">Lunch</p>
          <p id="lunchDetails">{selectedMeal?.lunchDish || "Not selected"}</p>
        </div>
        <div id="DinnerProfile">
          <p id="dinnerHead">Dinner</p>
          <p id="dinnerDetails">{selectedMeal?.dinnerDish || "Not selected"}</p>
        </div>
      </div>
    </div>
  );
}

function ResProfile() {
  const [userDetails, setUserDetails] = useState({}); // Replace with actual user details fetching
  const [mealSelections, setMealSelections] = useState([]);
  const [selectedDay, setSelectedDay] = useState(null);
  const [selectedMeal, setSelectedMeal] = useState(null);

  useEffect(() => {
    const residentId = "HR01"; // Replace with dynamic residentId if available
    axios
      .get(`/mealselection/${residentId}`)
      .then((response) => setMealSelections(response.data))
      .catch((error) =>
        console.error("Error fetching meal selections:", error)
      );
  }, []);

  useEffect(() => {
    if (selectedDay) {
      const meal = mealSelections.find(
        (meal) => meal.bookedDay === selectedDay
      );
      setSelectedMeal(meal || null);
    }
  }, [selectedDay, mealSelections]);

  return (
    <div id="resprocontainer">
      <NavbarBG />
      <NavbarItems2 />
      <ProfileHeading />
      <ProfileBoxBG userDetails={userDetails} />
      <BookingsHeading />

      <WeekButtonsInProfile onSelectDay={setSelectedDay} />
      {selectedDay && <BookingsDetailsInProfile selectedMeal={selectedMeal} />}
    </div>
  );
}

export default ResProfile;
